      "publication": "Das Denknetz (Zeitung)",
      "abstract": [
        {
          "lang": "de",
          "text": "Der Artikel argumentiert, dass ein linkes Kunstprogramm hinsichtlich der Menschen und ihrer Kunst nur radikal befreiend und ermächtigend sein kann. 1. Kunst bildet Kern und Kriterium eines Guten Lebens für alle; 2. Kunst wird durch den Kapitalismus privatisiert und instrumentalisiert; 3. Kunst muss dem Kapital entzogen werden, a) durch Aufhebung des Privateigentums, b) durch emanzipatorische Aneignung und Praxis, c) durch Analyse, Organisation und Verweigerung ästhetischer Arbeit."
        }
      ],
      "type": "magazine_article",
      "title": [
        {
          "lang": "de",
          "text": "Hat die Linke ein Kunstprogramm?"
        }
      ],
      "pages": 3
