      "abstract": [
        {
          "lang": "de",
          "text": "Materielle und immaterielle Kulturgüter werden nicht mehr nur als Zeugnisse vergangener Kulturen angesehen, sondern in ihrem Kontext auf soziale und ökonomische Aspekte früherer Gesellschaften untersucht. Aus dieser Perspektive spielen die Beschreibung und Darstellung von Funden und Befunden eine zentrale Rolle für das Sichtbarmachen von Zusammenhängen und für das Verständnis neuer Erkenntnisse. Die entsprechenden Darstellungsmethoden − weg von der Betrachtung einzelner Dinge hin zur Erforschung kultureller Zusammenhänge – hinken dabei jedoch hinterher, da moderne Informationsvisualisierungen, die hierfür geeignet wären, bislang kaum entwickelt und genutzt wurden.\r\nFabienne Kilchör präsentiert in ihrer Publikation Verfahren, die gleichermaßen für die wissenschaftliche Forschung als auch für die Wissensvermittlung geeignet sind. Von zentraler Bedeutung ist dabei die eigens entwickelte Zeichenschrift „Diglû“ mit über 400 in eine Schreibschrift eingebetteten Piktogrammen, die eine gestalterunabhängige Anwendung und Datenanalyse ermöglicht. Präsentiert werden Darstellungsprinzipien, Maßnahmen aus dem Bereich der visuellen Kommunikation und Methoden des Informationsdesigns. Die Verwendung von Diglû wird in Karten, einer Harris-Matrix und einer Datenbank ebenso vorgeführt wie bei neuartigen Darstellungsmethoden mittels Informationsgrafiken. Neben der Darlegung der wissenschaftlichen Grundlagen finden sich zahlreiche Anwendungsbeispiele aus dem Bereich der Vorderasiatischen Archäologie und Anleitungen für die Nutzung der Verfahren."
        }
      ],
