      "publication": "Weltformat Magazin: Not (Yet) Cancelled",
      "abstract": [
        {
          "lang": "en",
          "text": "The theme of this year’s edition of Weltformat, “Not (yet) cancelled,” is a direct reference to the cancellations of events around the world due to the pandemic. While the festival is a prudently hopeful celebration of how designers have adapted to these widespread changes, the past months’ upheavals have not been limited to the health crisis. Global protests in favor of feminism, trans rights, against systemic racism or governments’ inaction in the face of the climate catastrophe have contributed to making these issues increasingly visible and urgent. These urgent issues add a broader dimension to the theme. With this in mind, the festival is not just a celebration of how design manages to adapt to technological changes, trends and varying needs. It is also a moment to reflect, a space to rethink how we approach the discipline and consider how we might do things differently."
        }
      ],
