      "book_section_type": "chapter",
      "abstract": [
        {
          "lang": "de",
          "text": "6,2 Millionen Erwachsene in Deutschland haben Schwierigkeiten beim Lesen und Verstehen kurzer Texte (BMBF, 2019). In unserer literalen Gesellschaft ist Lesen eine Grundvoraussetzung um am gesellschaftlichen Leben teilzuhaben. Wenn wir über die Zukunft des Lesens nachdenken, stellt sich die Frage, was wir als Designer und Designforscher beitragen können, um das Lesen und Textverstehen für schwache Leser zu erleichtern.\r\nSeit einigen Jahren wird in der Praxis und auch in der Forschung das Phänomen Leichte Sprache diskutiert. Hauptdesiderat der Forschung ist dabei die empirische Überprüfung der in der Praxis entwickelten Regeln der Vereinfachung. Die zentrale Frage ist dabei, wie verständlich Leichte Sprache für die Zielgruppe ist. Der Beitrag der visuellen Gestaltung zur\r\nLesbarkeit und Leserlichkeit Leichter Sprache wird dabei erst seit 2016 erforscht.\r\nIm vorliegenden Artikel werden zwei Studien vorgestellt, die neben theoretischen\r\nErkenntnissen auch konkrete Anhaltspunkte für die Praxis der Gestaltung von Leichter Sprache bieten und Unternehmen und Behörden einen Weg weisen, wie sie erfolgreich mit Menschen kommunizieren könnten, die Schwierigkeiten beim Lesen und Verstehen kurzer Texte haben."
        }
      ],
