      "abstract": [
        {
          "lang": "en",
          "text": "Since the beginning of the pandemic social media, poster campaigns by international advertising agencies and, last but not least, art have featured images of health workers as superheroes. These pictures are intended to pay tribute to the so-called ‘everyday heroes’ for their ‘fight’ against the invisible ‘enemy’ Covid-19. The pictorial heroisation of the health professions is questioned in the interview with the nursing expert Prof. Dr. Sabine Hahn."
        }
      ],
      "type": "other",
