      "refereed": "FALSE",
      "divisions": [
        "BFH-OE--HKB",
        "BFH-OE--IN-0005"
      ],
      "publication": "Swiss Design Awards blog",
      "abstract": [
        {
          "lang": "en",
          "text": "Many design projects are the result of a long-term effort. They broadly fall into one of two categories. On the one hand, there are significant projects realised over extended periods of development. On the other, there are series of commissions for the same client or on a similar topic over a number of years. Both categories come with their challenges. The former can test designers’ ability to sustain their focus and energy, keep the flame alive or adapt to changes in trends and techniques. The latter confronts them with the need to reinvent themselves, the risk of creative inertia, and a potential impact on their portfolio and client list. However, these long-term projects also allow designers to develop and refine an language that is distinctively their own."
        }
      ],
      "type": "magazine_article",
      "title": [
        {
          "lang": "en",
          "text": "Time and the Essence"
        }
      ]
