      "publication": "Docupedia-Zeitgeschichte",
      "abstract": [
        {
          "lang": "de",
          "text": "Digitale Spiele sind integraler Teil der „Digitalen Revolution“. Sie dienen nicht nur als Trägermedium von Geschichtsbildern, sondern können als wirtschaftliche und kulturelle Artefakte konkreter menschlicher Gesellschaften begriffen werden. Im Zuge ihrer Verbreitung zum Massenphänomen beeinflussten sie Ästhetik und Narrative anderer Medien – und sind zu einem internationalen Milliardengeschäft geworden. Der Artikel von Eugen Pfister und Tobias Winnerling gibt einen Überblick der unterschiedlichen Begrifflichkeiten und eine Chronologie der Spieleentwicklung, um dann Digitale Spiele aus Sicht der Geschichtswissenschaften zu beleuchten."
        }
      ],
